/** @constant
 * @name MEETING_LIST
 *  @type {string}
 *  @default
 */
export const MEETING_LIST = '/api/zoom/meetings';

/** @constant
 * @name GET_SIGNATURE
 *  @type {string}
 *  @default
 */
export const GET_SIGNATURE = '/api/zoom/get_signature';

/** @constant
 * @name ZOOM_JS_LIBRARY_URL
 *  @type {string}
 *  @default
 */
export const ZOOM_JS_LIBRARY_URL = 'https://source.zoom.us/2.11.5/lib';

/** @constant
 * @name SCHEDULE_MEETING
 *  @type {string}
 *  @default
 */
export const SCHEDULE_MEETING = '/api/zoom/add_meeting';
